new Handler() {

            public void handleMessage(Message msg) {
            	int shiftX = msg.getData().getInt("shiftX");
                 switch (msg.what){
                 case firing_start:
                	 onFiringStart(shiftX);
                	break;
                 case firing_update:
                	 onScroll(shiftX);
                	break;
                 case firing_stop:
                	 onFiringStop(shiftX);
 					isAnimating = false;
                	break;
                 case restoring_start:
                	 onRestoringStart(shiftX);
                	break;
                 case restoring_update:
                	 onScroll(shiftX);
                	break;
                 case restoring_stop:
                	 isAnimating = false;
                	 onRestoringStop(shiftX);
                	 break;
                 }


            }
        }

